import React from 'react';
import AppointmentForm from './components/AppointmentForm';
import AppointmentTable from './components/AppointmentTable';

function App() {
  return (
    <div className="App">
      <h1>Patient Scheduling</h1>
      <AppointmentForm />
      <AppointmentTable />
    </div>
  );
}

export default App;
